      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n \n  \u003Cdiv style=\"width: 90%;\"\u003E\n      \n    \u003Ch2\u003EInstructions\u003C\u002Fh2\u003E\n    \u003Cp class=\"text-left\"\u003Eこの実験では、人がどのように単語を処理しているかを検討します。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E単語が画面（ディスプレイ）の中央に提示されますので、提示された単語が本物の単語なのか、それとも偽物の意味を成さない単語なのかを考えてください。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003Eもし、画面上の単語が　寒い　のように意味のある本物の単語だと思えば、\u003Ckbd\u003E${ window.word_key }\u003C\u002Fkbd\u003E　キーを押してください。一方、もし　力言　のような意味を成さない単語であれば、\u003Ckbd\u003E${ window.nonword_key }\u003C\u002Fkbd\u003E　キーを押してください。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E練習試行では、キー押しに対して正解・不正解のフィードバックをします。またこのキー押しは、できるだけ早く、また正確に行うよう心がけて欲しいと思います。なお、すべての単語に対して3秒以内で反応する必要があります。\u003C\u002Fp\u003E\n  \n  \u003C\u002Fdiv\u003E\n\n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  \u003Ckbd\u003ESPACE BAR\u003C\u002Fkbd\u003E を押すと練習試行が始まります。 \n\u003C\u002Ffooter\u003E",
